  02> MACLEAN, Ella Frimley Tylee
  b 08.03.1987
  Ella b. at Hastings. Her interests are sport and music.
  03> MACLEAN, Piera Rose Palmer Tylee
  b 30.06.1993
  Piera b. at Hastings. Her interests are gymnastics and swimming.
  03> 'MACLEAN, Kenneth Edward m on 26.04.1927 to (2) McWILLIAM, Muriel Mary Annie
  b 26.01.1883 d 22.08.1943
  b 28.03.1883 d 02.07.1957
  Kenneth m, at St Luke's Church, Havelock North, and d. and bd. at Hastings. Muriel, d/o Rev James McWilliam
  (Maori Missioner of Otaki) and his wife, Emily, b, at Otaki and d. at Hastings.
  Kenneth was Canon of Waiapu (1918-30), Archdeacon of Hawkes Bay (1930-43) and Vicar General (1933-38). He
  was the author of "The Living Church", "A Religion for Monday Morning", "The Pearl Merchant" and "Our
  Reasonable Service".
  Muriel was a nursing sister before her marriage. She had become co-founder, co-owner and co-matron of
  Royston Hospital, Hastings.
  04> MACLEAN, Margaret Elizabeth m on 07.11.1906 to CURRIE, George William
  b 04.10.1884 d 29.05.1951
  b 19.02.1878 d 16.04.1958
  Elizabeth b. at Foxton, m. at Napier and d, at Wanganui. George d. at Wanganui.
  George was a barrister and solicitor at Wanganui. He served as Chairman of the Board of
  Trustees of Wanganui Collegiate School.
  01> CURRIE, Margaret Isobel m on 31.07.1934 to BLYTH, Harrison David
  b 29.08.1908 d 05.07.1997
  b 22.11.1904 d 10.07.1996
  Margaret b., m. and d. at Wanganui. Harrison, s/o David Laing Blyth and Jeannie Hunter.
  Margaret was educated at Nga Tawa and Harrison at Wanganui Collegiate School. They farmed "Harakeke", a
  5,000 acre coastal property near Wanganui. The farm has recently been sold and is now planted in pines
  and known as Harakeke Forest. Margaret and Harrison moved to Wanganui in 1988.
  01> BLYTH, Gillian Jean m on 13.03.1957 to GOURLAY, John Francis Stewart
  b 15.01.1937
  b 15.03.1935
  Address: Auchencheyne, Moniaive, Thornhill, Dumfriesshire DG3 4EP, Scotland.
  Gillian was educated at Nga Tawa (prefect) and John at Loretto, Musselburgh, Edinburgh, Scotland.
  John is a farmer.
  01> GOURLAY, James Stewart m on 16.04.1983 to MACLEOD, Sara Helen
  b 02.01.1959
  b 14.03.1960
  James b, at Dumfries, Scotland and m, at Plymouth, Devon, England. Sara, d/o Peter Thomas
  Macleod and Valarie Northcott, b, at Fulford, Yorkshire, England.
  James was educated at Loretto and is an Aircraft Engineering Officer (Lt Cmdr) in the Royal
  Navy. Sara is an aerobics instructor.
  01> GOURLAY, Hamish John Stewart
  b 20.08.1985
  Hamish b. at Truro, Cornwall, England.
